// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./MemberMatrix.sol";
import { Constant } from './Constant.sol';

contract CompanyModel {
    MemberMatrix _director;

    address payable private _companyBuilder;
    uint _total_mem;
    string _companyName;
    mapping ( address => uint256 ) private _members;

    constructor (){
        _companyBuilder = payable(msg.sender);
        _total_mem = 10;
        _companyName = "Sinsong";
        _director = new MemberMatrix(payable( msg.sender ) , "James", block.timestamp,3,5);
    }

    function createModel (
        address payable companyBuilder,
        string memory companyname
    ) external {
        _companyBuilder = payable(companyBuilder);
        _companyName = companyname;
    }

    function totalMembers() public view returns (uint ){
        return _total_mem;
    }
    
    function setCompanyName(string memory name) public {
        _companyName = name;
    }

    function display () external view returns (string memory) {
        return _director.getName();
    }  
}
